import React from "react";

const App = () => {
  return (
    <div>
      <section class="hero">
        <div class="hero-body">
         <div class="container has-text-centered">
             <h1 class="title">Prime Cacther!</h1>
             <h2 class="subtitle">素数とあそぼう</h2>
         </div>
        </div>
      </section>
      <footer class="footer">
        <div class="content has-text-centered">
         <p>
            <strong>©︎2020 Prime-Cacther</strong> by <i className="fab fa-github fa-2x"></i><a href="https://github.com/Kohzuki-Nanako/prime-catch">Github</a> The source code is licensed         
        </p>
        </div>
    　</footer>
    </div>

  );
};

export default App;
